import React from 'react'

import './loginForm.css'
class LogForm extends React.Component{

    //初始化
    state={month: '', day: '', thing: '', duration: ''}

    //设置
    dataChange=(names)=>{
        return(e)=>{
            this.setState({[names]:e.target.value})
        }
    }

    render(){
        console.log(this.props,this.state);
        let {month, day, thing, duration} = this.state;
        return(
            <div className='form1'>
                <form onSubmit={this.sub}>
                <span>月份</span><input onChange={this.dataChange('month')}></input><br />
                        <span>日期</span><input onChange={this.dataChange('day')}></input><br />
                        <span>任务</span><input onChange={this.dataChange('thing')}></input><br />
                        <span>时间</span><input onChange={this.dataChange('duration')}></input><br />
                        <button onClick={this.props.subMit(month, day, thing, duration)}>添加</button>
                    </form>
                    <div className='search'>
                        <input type='text' onChange={this.searchT}></input><span onClick={this.search}>搜索</span>
                    </div>
            </div>
        )
    }
}

export default LogForm
